describe('Actual translation', () => {
  it('consistent translation of simple code', async () => {
    const newcode = await runTranslation({ fromLanguage: 'Python', toLanguage: 'Java', code: 'print("hello world")' }) // Translate code
    const oldcode = await runTranslation({ fromLanguage: 'Java', toLanguage: 'Python', code: newcode }) // Reverse translation
    expect(oldcode).toContain('print("hello world")') // Check that the retranslated code contains starting code
  }, 100000)

  it('throws error when input code is in different language', async () => {
    return expect(async () => {
      await runTranslation({ fromLanguage: 'C', toLanguage: 'Python', code: 'print("hello world")' })
    }).rejects.toThrow('Wrong language')
  }, 100000)

  it('throws error when given nonsense', async () => {
    const nonsense = 'The quick brown fox jumps over the lazy dog'
    return expect(async () => {
      await runTranslation({ fromLanguage: 'Java', toLanguage: 'SQL', code: nonsense })
    }).rejects.toThrow('Invalid input')
  }, 100000)

  it('throws error when message is too long', async () => {
    return expect(async () => {
      await runTranslation({ fromLanguage: 'Java', toLanguage: 'SQL', code: toolong })
    }).rejects.toThrow('Input code is too long')
  }, 100000)
  it('throws error when message is empty', async () => {
    return expect(async () => {
      await runTranslation({ fromLanguage: 'Java', toLanguage: 'SQL', code: '' })
    }).rejects.toThrow('No code')
  }, 100000)
})

describe('Actual Optimization', () => {
  it('condenses redundant code', async () => {
    const lang = 'Python'
    const longcode = 'x=0\nx+=1\nx+=1\nx+=1\nx+=1\nx+=1\nx+=1\nx+=1\nx+=1\nx+=1\nx+=1\nprint(x)' // Inefficient code
    const oldlength = longcode.length
    const shortcode = await runTranslation({ fromLanguage: lang, toLanguage: lang, code: longcode }) // Call optimization
    expect(shortcode.length).toBeLessThan(oldlength) // Make sure optimized code is shorter than unoptimized code
  }, 100000)
  it('throws error when input code is in different language', async () => {
    return expect(async () => {
      await runTranslation({ fromLanguage: 'C', toLanguage: 'C', code: 'print("hello world")' })
    }).rejects.toThrow('Wrong language')
  }, 100000)
  it('throws error when given nonsense', async () => {
    const nonsense = 'El rpido zorro marrn salta sobre el perro perezoso.'
    return expect(async () => {
      await runTranslation({ fromLanguage: 'SQL', toLanguage: 'SQL', code: nonsense })
    }).rejects.toThrow('Invalid input')
  }, 100000)
  it('throws error when message is too long', async () => {
    return expect(async () => {
      await runTranslation({ fromLanguage: 'Java', toLanguage: 'Java', code: toolong })
    }).rejects.toThrow('Input code is too long')
  }, 100000)
  it('throws error when message is empty', async () => {
    return expect(async () => {
      await runTranslation({ fromLanguage: 'Java', toLanguage: 'Java', code: '' })
    }).rejects.toThrow('No code')
  }, 100000)
})
